x / td * Math.exp(Math.pow(x/td,2)) * Math.exp(-x/8.77);\n}\n\nfunction f2(x,td){\n    return x / td * Math.exp(Math.pow(x/td,2)) * Math.exp(-x/111);\n}\n\ndx = 0.1;       // width of the trapezoids\n\nvar tni = 8.8;\nvar tco = 111.3;\nvar epni = 3.9e10;\nvar epco = 6.8e9;\nvar beta = 13.8;\nvar c = 1.0e10;\nvar msol = 2e33;\nvar m = mej.value;\nm = m * msol;\nvar mni = fni.value;\nmni = mni * m;\nvar v = vej.value;\nv = v * Math.pow (10,5);\nvar k = k.value;\nvar td = Math.sqrt(2. * k * m / (beta * c * v)) / 86400;\nvar data = source.data;\nx = data['x']\ny = data['y']\nfor (j = 0; j &lt; x.length; j++) {\n    int1 = numerically_integrate(0,x[j],dx,f1,td);\n    int2 = numerically_integrate(0,x[j],dx,f2,td);\n    factor = 2 * mni / td * Math.exp(-Math.pow(x[j]/td,2));\n    y[j] = factor * ((epni-epco) * int1 + epco * int2);\n}\nsource.change.emit();\n"},"id":"4cd04f62-2357-4c4f-9371-8d89876b40fa","type":"CustomJS"},{"attributes":{"source":{"id":"910bab48-50b0-4733-aa9b-858815d1251b","type":"ColumnDataSource"}},"id":"207b6860-758e-4659-a184-acc71d206372","type":"CDSView"},{"attributes":{},"id":"f7a3f629-ef83-46d4-9822-4db5b5ee1bec","type":"UnionRenderers"},{"attributes":{"callback":null,"data":{},"selected":{"id":"3d718254-a14c-43b5-9168-6ff10925faac","type":"Selection"},"selection_policy":{"id":"6f06e483-9b6d-4e67-9331-479b5d07d732","type":"UnionRenderers"}},"id":"15e530c5-839e-426c-a680-900905c1463a","type":"ColumnDataSource"},{"attributes":{},"id":"6a541a74-54e7-4d52-b97d-3548896154c7","type":"Selection"},{"attributes":{"line_alpha":0.6,"line_color":"#1f77b4","line_width":3,"x":{"field":"x"},"y":{"field":"y"}},"id":"9a884061-3406-4dfb-8a27-7f87edda5a8e","type":"Line"},{"attributes":{"fill_alpha":{"value":0.5},"fill_color":{"value":"turquoise"},"line_alpha":{"value":0.5},"line_color":{"value":"turquoise"},"size":{"units":"screen","value":5},"x":{"value":58132.113},"y":{"value":22.560295113491968}},"id":"873513f4-8798-42a3-971e-f5146c1b2eba","type":"Circle"},{"attri
